    function getPossibleTerrain(marginal){
        
        var terrain = []

        for(var i=0;i < marginal.length; i++){
            if(marginal[i]> 0){
                terrain.push({marginal:marginal[i], terrain: cType[i]}) 
            }
        }

        return _.sortByOrder(terrain, ['marginal'], ['desc'])

    }

    function setToMax(idx){

        // idx is base 0

        var marginal = getTerrainMarginal(idx)
        var indexOfMaxValue = marginal.reduce(function(iMax,x,i,a) {return x>a[iMax] ? i : iMax;}, 0);
        console.log(indexOfMaxValue + " is " + marginal[indexOfMaxValue] + " and is .." + cType[indexOfMaxValue])

        getPossibleTerrain(marginal)

        var cell = indexToCoord(idx, map.bounds)
        cell.terrain = cType[indexOfMaxValue]

        map.updateTerrain(cell)

    }

    function getTerrainIdx(terrain){
        for(var i=0;i<cType.length;i++){
            if(cType[i] == terrain){
                return i
            }
        }
    }

    function getConditionalMarginals(cellIdx){

        var selector = '.content div:nth-child(' + cellIdx  + ')';
        var el = document.querySelector(selector);
        var selectedTerrain = $(el).attr("class").replace("selected", "").trim()
        console.log(selectedTerrain)
        // Find idx of terrain
        var terrainIdx = getTerrainIdx(selectedTerrain)
        return cpd[terrainIdx];


    }

    
    $(".miniPallet").on("click", ".item", function(){


        // Update Current Cell to selected Terrain
        var selectedTerrain = $(".icon", this).attr("class").replace("icon", "").trim();
        
        var cellIdx = $(".miniPallet .selectedIdx").val()
        var cell = indexToCoord(cellIdx, map.bounds)
        
        cell.terrain = selectedTerrain
        map.updateTerrain(cell);

        // Calculate other cells based on this information
        var neightborMarginals = getConditionalMarginals(cellIdx,0);
        conslole.dir(getPossibleTerrain(neightborMarginals))
       
        $(".miniPallet").hide();
        
    })

    $(".predict").on("click", function(){

        predicting = !predicting
        
        if(predicting){
            $(".predict .msg").text("Predicting")
            $(".content div").removeClass();
            $(".content div").addClass("unknown");

            //$(".miniPallet").show();

            // Set value to largest
            
            //setToMax(0)

        } else {
            $(".predict .msg").text("Predict")
            map.drawMap(map.bounds);
        }

    })
    
